import img_mario from '../../img/loading/imgloading.jpg'
import { Link } from "react-router-dom"

const Card = (datos_card)=>{
    const {  code, id, name, country_code, url} = datos_card;



    const urls = (imagen) => {
        const imageExtensions = /\.(jpg|jpeg|png|gif|bmp)$/i;
        return imageExtensions.test(imagen);
    };





return (<div className='principal' id={id}>
      <Link to={`/detail/${code}`} >
            <div className="containerCard">
            <img src={
                    urls(url)
                    ?url
                    :img_mario
                    } alt={name} className='imagengame'/>
             <div className='submenuCard'>
                <div className='textocards'>{name}</div>
                <div className='textocards2'>{country_code} </div>
            </div>
            </div>
            </Link>

    </div>)
}
export default Card;
